import * as Types from './../Constants/ActionTypes.jsx';

const initialState = {
  io: ''
};

export const socket = (state = initialState, action) => {
  switch (action.type) {
    case Types.SAVE_SOCKET:
      state.io = action.payload
      return {...state}
      break;
    default: return state
  }
}
